// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "./Issuer.sol";

contract ViewPerson {

    Issuer i;

    constructor(address _contractAddress){
        i =  Issuer(_contractAddress);
    }

    struct Person {
        address walletAddress;
        string fullName;
        uint amka;
        uint afm;
        string dob;
        uint mobile;
        string email;       
        string homeAddress;
        address issuedBy;
        bytes idHash;
    }  

    mapping(address => Person) public person;
    event IsRegistered(bool result);

    function getInfo() public{
       // Issuer i = Issuer(_contractAddress);
        if(i.getAddress(msg.sender) == msg.sender) {
        person[msg.sender].walletAddress = i.getAddress(msg.sender);
        person[msg.sender].fullName = i.getFullName(msg.sender);
        person[msg.sender].amka = i.getAmka(msg.sender);
        person[msg.sender].afm = i.getAfm(msg.sender);
        person[msg.sender].dob = i.getDob(msg.sender);
        person[msg.sender].mobile = i.getMobile(msg.sender);
        person[msg.sender].email = i.getEmail(msg.sender);
        person[msg.sender].homeAddress = i.getHomeAddress(msg.sender);
        person[msg.sender].issuedBy = i.getIssuer(msg.sender);
        person[msg.sender].idHash = i.getIdHash(msg.sender);
            emit IsRegistered(true);
        } else {
            emit IsRegistered(false);
        }
    }

    // function personInfo(address _contractAddress) public view returns (address, string memory, uint, uint, uint, string memory, string memory, string memory, address) {
    //     Issuer i = Issuer(_contractAddress);
    //     return i.viewPerson(msg.sender);
    // }




}
